import ItemLink from "./ItemLink"

const ListLinkComponents = (props) => {
    const {elements} = props

    return (
        <ul>
            {elements.map((elements, i) => <ItemLink href={`${elements.href}`} content={elements.content}></ItemLink>)}
        </ul>
    )
}

export default ListLinkComponents
